function () {
      var newMultiImageFieldName = _faker["default"].lorem.word(10);

      if (newMultiImageFieldName === 'id') {
        newMultiImageFieldName += 's';
      }

      cy.step('Choose Multi-image field');
      var form = fieldSettings.clickOption('SetImageRef');
      cy.step("Set multi-image field name to ".concat(newMultiImageFieldName));
      form.fill({
        label: newMultiImageFieldName,
        helpText: _faker["default"].lorem.words(3)
      }).clickSaveButton();
      cy.step('Click Save Collection button');
      collectionSettings.clickSaveCollectionButton();
      cy.step('Await for the api response and confirmation collection was updated');
      cy.wait('@update-collection').then(function (xhr) {
        expect(xhr.requestBody.fields.some(function (field) {
          return field.type === 'Set' && field.innerType === 'ImageRef' && field.name === newMultiImageFieldName;
        })).to.be["true"];
        expect(xhr.status).to.equal(200);
      });
      collectionSettings.getName().should('not.exist');
    }

function () {
      var name = _faker["default"].random.word();

      var newMultiImageFieldName = _faker["default"].lorem.word(10);

      if (newMultiImageFieldName === 'id') {
        newMultiImageFieldName += 's';
      }

      cy.step('Choose Multi-image field');
      var form = fieldSettings.clickOption('SetImageRef');
      cy.step("Set multi-image field name to ".concat(newMultiImageFieldName));
      form.fill({
        label: name,
        helpText: _faker["default"].lorem.words(3)
      }).clickSaveButton();
      cy.step('Click Save Collection button');
      collectionSettings.clickSaveCollectionButton();
      cy.step('Await for the api response and confirmation collection was updated');
      cy.wait('@update-collection').then(function (xhr) {
        expect(xhr.requestBody.fields.some(function (field) {
