function () {
    cy.step('publish the site to enable scheduled publishing');
    workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function () {
      cy.getByDataAutomationId('close-publish-dropdown-button').trigger('click');
      cmsTab = sidebar.clickCMSButton();
      cmsTab.getCollectionByName('Items').clickCollectionTab();
      cy.step('create new item and try to schedule');
      cy.getByDataAutomationId('cms-add-item-button').click();
      cy.getByDataAutomationId('dyn-item-name-input').type('My new scheduled project');
      cy.step('try to schedule the item');
      cy.getByDataAutomationId('item-edit-pane-dropdown').eq(0).click();
      cy.step('assert schedule option is disabled');
      cy.getByDataAutomationId('open-schedule-picker-option').should('have.class', 'bem-Menu_Item-disabled');
      cy.getByDataAutomationId('cms-panel-top-close-button').click();
      cy.getByDataAutomationId('discard-changes').click();
    });
  }

function () {
    _cypressAppControls.server.spy('POST', _cypressAppControls.server.paths.itemCreation).as('create-item');

    _cypressAppControls.server.spy('POST', _cypressAppControls.server.paths.itemScheduled).as('schedule-item');

    _cypressAppControls.server.spy('GET', _cypressAppControls.server.paths.cmsItems).as('get-item');

    cy.step('publish the site to enable scheduled publishing');
    workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function () {
      cy.getByDataAutomationId('close-publish-dropdown-button').trigger('click');
      cmsTab = sidebar.clickCMSButton();
      var cmsItems = cmsTab.getCollectionByName('Items').clickCollectionTab();
      cy.step('create new item and schedule');
      cy.getByDataAutomationId('cms-add-item-button').click();
      cy.getByDataAutomationId('dyn-item-name-input').type('Item to schedule');
      cy.getByDataAutomationId('item-edit-pane-dropdown').click();
      cy.getByDataAutomationId('open-schedule-picker-option').click();
      cy.step('assert schedule picker is opened');
      cy.getByDataAutomationId('schedule-picker').should('be.visible');
      cy.step('assert that timezone note appears');
      cy.getByDataAutomationId('sp-timezone-note').should('be.visible');
      cy.step('increment month');
      cy.getByDataAutomationId('date-picker-increment-month').click();
      cy.get('.bem-DatePicker_Days > div.bem-DatePicker_Day-activeCurrentMonth:first').click();
      cy.getByDataAutomationId('schedule-picker-button').click();
      cy.step('assert item was created');
      cy.wait('@create-item').then(function (xhr) {
        expect(xhr.status).to.equal(201);
      });
      cy.wait('@get-item').then(function (xhr) {
        expect(xhr.status).to.equal(200);
      });
      cy.step('Assert that the item manager panel is not visible');
      cmsItems.getNode().should('not.exist');
      cy.step('Assert that the top item has the name "Item to schedule"');
      cmsItems.getItemListRow().eq(0).within(function () {
        cmsItems.getItemColumn().eq(0).should('contain', 'Item to schedule');
      });
      cy.step('assert item was scheduled');
      cy.wait('@schedule-item').then(function (xhr) {
        expect(xhr.status).to.equal(201);
      });
    });
  }

function () {
    var itemsSettings = cmsTab.getCollectionByName('Items').clickSettingsButton();
    cy.step('change collection name');
    cy.get('.bem-TextInput').first().click().type('New Items');
    itemsSettings.clickSaveCollectionButton();
    cy.step('assert collection settings changes waring modal is displayed');
    cy.getByDataAutomationId('collection-settings-changed-confirm-modal').should('be.visible');
    cy.getByDataAutomationId('cancel').click();
    itemsSettings.clickCancelCollectionButton();
    cy.getByDataAutomationId('discard-changes').click();
