function () {
      cy.step('Add Collection List');
      workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('DynamoWrapper');
      workspace.getRightPanel().clickStylesTab().selector.setClassNames(['cy-list']);
      cy.step('Click collection binding dropdown');
      collectionSettings = canvas.getCollectionListSettings();
      collectionSettings.source.click();
      collectionSettings.source.clickOption('Cars');
      cy.step('Go to Settings Panel in the right panel');
      propertiesTab = workspace.getRightPanel().clickPropertiesTab();
      cy.step('Assert binding to `Cars` on the dropdown in settings panel');
      propertiesTab.getNode().within(function () {
        cy.get("[data-automation-id=\"dyn-dropdown\"]").should('contain', 'Cars');
      });
    }

function () {
      cy.step('Select Collection List Item');
      canvas.selectElement('.w-dyn-items > div:nth-of-type(1)');
      cy.step('Add a Heading into the first Dynamic Item node');
      workspace.getLeftSidebar().clickAddElementButton().clickBuiltinTab().clickOption('Heading');
      workspace.getRightPanel().clickStylesTab().selector.setClassNames(['cy-list-heading']);
      cy.step('In the Mini Settings, press the checkbox next to "Get Text from Cars"');
      miniSettings = canvas.miniSettings;
      binding = miniSettings.getBinding(0);
      binding.click();
      binding.field.click();
      binding.field.clickOption('Year');
      miniSettings.close();
      cy.step('In the Collection Style Settings area, enable "Get BG Color from Cars"');
      propertiesTab = workspace.getRightPanel().clickPropertiesTab();
      binding = propertiesTab.dynamicStyleSettings.getBinding(2);
      binding.click();
      cy.step('Pick "Color" from the dropdown');
      binding.field.click();
      binding.field.clickOption('Paint');
      cy.step('Assert property is picked');
      propertiesTab.dynamicStyleSettings.getNode().should('contain', 'Paint');
      cy.step('Assert collection list items have background color applied');
      canvas.within(function () {
        cy.get('.w-dyn-items').should('have.css', 'background-color');
      });
    }

