function () {
      cy.step('Click the CMS button to open the panel');
      cmsTab = sidebar.clickCMSButton();
      cy.step("Click the 'New Collection' button");
      settings = cmsTab.clickCreateNewCMSButton();
    }

function () {
      cy.step('Change collection title to "Cars"');
      settings.getName().clear().type('Cars');
    }

function () {
      cy.step('Change collection slug to "car"');
      settings.getSlug().clear().type('car');
      cy.step('Assert slug preview is "website.com/car/car-page');
      settings.getUrl().should('have.text', 'website.com/car/car-page');
    }

function () {
      cy.step('Create new field with type: "Number"');
      newField = settings.clickAddFieldButton();
      form = newField.clickOption('Number');
    }

function () {
      cy.step('Fill number field');
      form.fill({
        label: 'Year',
        helpText: 'Model year',
        min: 1901,
        max: 2020,
        required: true
      }); // TODO: Assert inputs before saving
    }

function () {
      cy.step('Click on save field button');
      form.clickSaveButton();
      cy.step('Assert that Number field was created in the Collection with name: "Year"');
      newField.getLabel('label').should('not.exist');
      settings.getCustomFieldsList().should('contain', 'Year').and('contain', '(Number)');
    }

function () {
      cy.step('Create new field with type: "Color"');
      newField = settings.clickAddFieldButton();
      form = newField.clickOption('Color');
    }

function () {
      cy.step('Fill color field');
      form.fill({
        label: 'Paint',
        helpText: 'Color of the Car',
        required: true
      }); // TODO: Assert inputs before saving
    }

function () {
      cy.step('Click on save field button');
      form.clickSaveButton();
      cy.step('Assert that Color field was created in the Collection with name: "Paint"');
      newField.getLabel('label').should('not.exist');
      settings.getCustomFieldsList().should('contain', 'Paint').and('contain', 'Color');
    }

function () {
      cy.step('Click to create the collection');
      settings.clickCreateCollectionButton();
      settings.getName().should('not.exist');
    }

function () {
      cy.step('Click to generate 5 dummy items');
      cmsItems = cmsTab.getCollectionByName('Cars').getDataPage();
      var dummyItemGenerator = cmsItems.getDummyItemGenerator();
      dummyItemGenerator.generateDummyData(5);
      cy.step('Assert that created items contain "Staged for Publish" text');
      cmsItems.getItemsList().within(function () {
        cy.get("[data-automation-id=\"cms-item-row\"]").then(function ($row) {
          cy.wrap($row).should('contain', 'Staged for Publish');
        });
      });
      cy.step('Assert that there are 5 items in the Collection List');
      cy.get("[data-automation-id=\"cms-item-row\"]").should('have.length', 5);
    }

function () {
      var pagesPanel = sidebar.clickPagesTab();
      pagesPanel.switchPage('Cars Template');
    }

function () {
      cy.step('Insert a new heading');
      sidebar.clickAddElementButton().clickBuiltinTab().clickOption('Heading');
      stylesTab.selector.setClassNames(['item-name-heading']);
      cy.step('With the selected heading, click the properties tab');
      var propsTab = rightPanel.clickPropertiesTab();
      cy.step('Bind the heading text to the item name field');
      var binding = propsTab.getBinding(0);
      binding.click();
      binding.field.click();
      binding.field.clickOption('Name');
      cy.step('Assert binding is set');
      propsTab.getNode().within(function () {
        cy.get("[data-automation-id=\"dyn-bind-select\"]").should('contain', 'Name');
      });
    }

function () {
      cy.step('Publish site');
      workspace.getTopbar().clickPublishButton().clickPublishSelectedDomainsButton().waitUntilDonePublishing().then(function (href) {
        canvas.within(function () {
          cy.get('h1').eq(0).invoke('text').then(function (text1) {
            Cypress.env('pageUrl', href);
            Cypress.env('headingText', text1);
          });
        });
      });
    }

function () {
      cy.step('Assert created elements exist on published site');
      cy.forceVisit(Cypress.env('pageUrl'));
      cy.get('.item-name-heading').should('exist');
      cy.get('.item-name-heading').should('have.text', Cypress.env('headingText'));
    }
